import React from "react";
import "./WorkDisplayTemplate.css";
import extend from "../images/extend-png-4.png";

function WorkDisplayTemplate() {
  let square = "u025A1";
  return (
    <>
      <section className="WorkDisplayTemplateContainer">
        <section className="WorkInformations"></section>
        <section className="WorkDescription">
          {/* <button className="resize"> */}
          <p className="square">&#9633;</p>
          {/* </button> */}
        </section>
      </section>
    </>
  );
}

export default WorkDisplayTemplate;
